import styled from "styled-components";


export const Container = styled.section`

  //b4b4b4

  height: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;

  div:nth-child(1) {
    display: flex;
    justify-content: center;
    align-items: center;

    h1 {
      color: #b4b4b4;
    }
  }

  div:nth-child(2) {
    width: 12rem;
    height: 12rem;
    background: #fff;
    display: flex;
    justify-content: center;
    align-items: center;

    border-radius: 0.25rem;

    img {
      opacity: 0.5;
    }
  }

`;
